svg.script:
"use strict";
var detailsTc, searchbtnTc, unzoombtnTc, matchedtxtTc, svgTc, searchingTc, currentSearchTermTc, ignorecaseTc, ignorecaseBtnTc;
function init_tc(evt) {
	detailsTc = document.getElementById("details-tc").firstChild;
	searchbtnTc = document.getElementById("search-tc");
	ignorecaseBtnTc = document.getElementById("ignorecase-tc");
	unzoombtnTc = document.getElementById("unzoom-tc");
	matchedtxtTc = document.getElementById("matched-tc");
	svgTc = document.getElementById("flamegraph-tc");
	searchingTc = 0;
	currentSearchTermTc = null;
}

window.addEventListener("click", function(e) {
	var target = find_group_tc(e.target);
	if (target) {
		if (target.nodeName == "a") {
			if (e.ctrlKey === false) return;
			e.preventDefault();
		}
		if (target.classList.contains("parent")) unzoom_tc();
		zoom_tc(target);
	}
	else if (e.target.id == "unzoom-tc") unzoom_tc();
	else if (e.target.id == "search-tc") search_prompt_tc();
	else if (e.target.id == "ignorecase-tc") toggle_ignorecase_tc();
}, false)

// mouse-over for info
// show
window.addEventListener("mouseover", function(e) {
	var target = find_group_tc(e.target);
	if (target) detailsTc.nodeValue = "Function: " + g_to_text_tc(target);
}, false)

// clear
window.addEventListener("mouseout", function(e) {
	var target = find_group_tc(e.target);
	if (target) detailsTc.nodeValue = ' ';
}, false)

// functions
function find_child_tc(node, selector) {
	var children = node.querySelectorAll(selector);
	if (children.length) return children[0];
	return;
}
function find_group_tc(node) {
	var parent = node.parentElement;
	if (!parent) return;
	if (parent.id == "frames-tc") return node;
	return find_group_tc(parent);
}
function orig_save_tc(e, attr, val) {
	if (e.attributes["_orig_" + attr] != undefined) return;
	if (e.attributes[attr] == undefined) return;
	if (val == undefined) val = e.attributes[attr].value;
	e.setAttribute("_orig_" + attr, val);
}
function orig_load_tc(e, attr) {
	if (e.attributes["_orig_"+attr] == undefined) return;
	e.attributes[attr].value = e.attributes["_orig_" + attr].value;
	e.removeAttribute("_orig_"+attr);
}
function g_to_text_tc(e) {
	var text = find_child_tc(e, "title").firstChild.nodeValue;
	return (text)
}
function g_to_func_tc(e) {
	var func = g_to_text_tc(e);
	// if there's any manipulation we want to do to the function
	// name before it's searched, do it here before returning.
	return (func);
}
function update_text_tc(e) {
	var r = find_child_tc(e, "rect");
	var t = find_child_tc(e, "text");
	var w = parseFloat(r.attributes.width.value) -3;
	var txt = find_child_tc(e, "title").textContent.replace(/\([^(]*\)$/,"");
	t.attributes.x.value = parseFloat(r.attributes.x.value) + 3;

	// Smaller than this size won't fit anything
	if (w < 2 * 12 * 0.59) {
		t.textContent = "";
		return;
	}

	t.textContent = txt;
	// Fit in full text width
	if (/^ *$/.test(txt) || t.getSubStringLength(0, txt.length) < w)
		return;

	for (var x = txt.length - 2; x > 0; x--) {
		if (t.getSubStringLength(0, x + 2) <= w) {
			t.textContent = txt.substring(0, x) + "..";
			return;
		}
	}
	t.textContent = "";
}

// zoom
function zoom_reset_tc(e) {
	if (e.attributes != undefined) {
		orig_load_tc(e, "x");
		orig_load_tc(e, "width");
	}
	if (e.childNodes == undefined) return;
	for (var i = 0, c = e.childNodes; i < c.length; i++) {
		zoom_reset_tc(c[i]);
	}
}
function zoom_child_tc(e, x, ratio) {
	if (e.attributes != undefined) {
		if (e.attributes.x != undefined) {
			orig_save_tc(e, "x");
			e.attributes.x.value = (parseFloat(e.attributes.x.value) - x - 10) * ratio + 10;
			if (e.tagName == "text")
				e.attributes.x.value = find_child_tc(e.parentNode, "rect[x]").attributes.x.value + 3;
		}
		if (e.attributes.width != undefined) {
			orig_save_tc(e, "width");
			e.attributes.width.value = parseFloat(e.attributes.width.value) * ratio;
		}
	}

	if (e.childNodes == undefined) return;
	for (var i = 0, c = e.childNodes; i < c.length; i++) {
		zoom_child_tc(c[i], x - 10, ratio);
	}
}
function zoom_parent_tc(e) {
	if (e.attributes) {
		if (e.attributes.x != undefined) {
			orig_save_tc(e, "x");
			e.attributes.x.value = 10;
		}
		if (e.attributes.width != undefined) {
			orig_save_tc(e, "width");
			e.attributes.width.value = parseInt(svgTc.width.baseVal.value) - (10 * 2);
		}
	}
	if (e.childNodes == undefined) return;
	for (var i = 0, c = e.childNodes; i < c.length; i++) {
		zoom_parent_tc(c[i]);
	}
}
function zoom_tc(node) {
	var attr = find_child_tc(node, "rect").attributes;
	var width = parseFloat(attr.width.value);
	var xmin = parseFloat(attr.x.value);
	var xmax = parseFloat(xmin + width);
	var ymin = parseFloat(attr.y.value);
	var ratio = (svgTc.width.baseVal.value - 2 * 10) / width;

	// XXX: Workaround for JavaScript float issues (fix me)
	var fudge = 0.0001;

	unzoombtnTc.classList.remove("hide");

	var el = document.getElementById("frames-tc").children;
	for (var i = 0; i < el.length; i++) {
		var e = el[i];
		var a = find_child_tc(e, "rect").attributes;
		var ex = parseFloat(a.x.value);
		var ew = parseFloat(a.width.value);
		var upstack;
		// Is it an ancestor
		if (0 == 0) {
			upstack = parseFloat(a.y.value) > ymin;
		} else {
			upstack = parseFloat(a.y.value) < ymin;
		}
		if (upstack) {
			// Direct ancestor
			if (ex <= xmin && (ex+ew+fudge) >= xmax) {
				e.classList.add("parent");
				zoom_parent_tc(e);
				update_text_tc(e);
			}
			// not in current path
			else
				e.classList.add("hide");
		}
		// Children maybe
		else {
			// no common path
			if (ex < xmin || ex + fudge >= xmax) {
				e.classList.add("hide");
			}
			else {
				zoom_child_tc(e, xmin, ratio);
				update_text_tc(e);
			}
		}
	}
	search_tc();
}
function unzoom_tc() {
	unzoombtnTc.classList.add("hide");
	var el = document.getElementById("frames-tc").children;
	for(var i = 0; i < el.length; i++) {
		el[i].classList.remove("parent");
		el[i].classList.remove("hide");
		zoom_reset_tc(el[i]);
		update_text_tc(el[i]);
	}
	search_tc();
}

// search
function toggle_ignorecase_tc() {
	ignorecaseTc = !ignorecaseTc;
	if (ignorecaseTc) {
		ignorecaseBtnTc.classList.add("show");
	} else {
		ignorecaseBtnTc.classList.remove("show");
	}
	reset_search_tc();
	search_tc();
}
function reset_search_tc() {
	var el = document.querySelectorAll("#frames-tc rect");
	for (var i = 0; i < el.length; i++) {
		orig_load_tc(el[i], "fill")
	}
}
function search_prompt_tc() {
	if (!searchingTc) {
		var term = prompt("Enter a search term (regexp " +
		    "allowed, eg: ^ext4_)"
		    + (ignorecaseTc ? ", ignoring case" : "")
		    + "\nPress Ctrl-i to toggle case sensitivity", "");
		if (term != null) {
			currentSearchTermTc = term;
			search_tc();
		}
	} else {
		reset_search_tc();
		searchingTc = 0;
		currentSearchTermTc = null;
		searchbtnTc.classList.remove("show");
		searchbtnTc.firstChild.nodeValue = "Search"
		matchedtxtTc.classList.add("hide");
		matchedtxtTc.firstChild.nodeValue = ""
	}
}
function search_tc(term) {
	if (currentSearchTermTc === null) return;
	var term = currentSearchTermTc;

	var re = new RegExp(term, ignorecaseTc ? 'i' : '');
	var el = document.getElementById("frames-tc").children;
	var matches = new Object();
	var maxwidth = 0;
	for (var i = 0; i < el.length; i++) {
		var e = el[i];
		var func = g_to_func_tc(e);
		var rect = find_child_tc(e, "rect");
		if (func == null || rect == null)
			continue;

		// Save max width. Only works as we have a root frame
		var w = parseFloat(rect.attributes.width.value);
		if (w > maxwidth)
			maxwidth = w;

		if (func.match(re)) {
			// highlight
			var x = parseFloat(rect.attributes.x.value);
			orig_save_tc(rect, "fill");
			rect.attributes.fill.value = "rgb(230,0,230)";

			// remember matches
			if (matches[x] == undefined) {
				matches[x] = w;
			} else {
				if (w > matches[x]) {
					// overwrite with parent
					matches[x] = w;
				}
			}
			searchingTc = 1;
		}
	}
	if (!searchingTc)
		return;

	searchbtnTc.classList.add("show");
	searchbtnTc.firstChild.nodeValue = "Reset Search";

	// calculate percent matched, excluding vertical overlap
	var count = 0;
	var lastx = -1;
	var lastw = 0;
	var keys = Array();
	for (k in matches) {
		if (matches.hasOwnProperty(k))
			keys.push(k);
	}
	// sort the matched frames by their x location
	// ascending, then width descending
	keys.sort(function(a, b){
		return a - b;
	});
	// Step through frames saving only the biggest bottom-up frames
	// thanks to the sort order. This relies on the tree property
	// where children are always smaller than their parents.
	var fudge = 0.0001;	// JavaScript floating point
	for (var k in keys) {
		var x = parseFloat(keys[k]);
		var w = matches[keys[k]];
		if (x >= lastx + lastw - fudge) {
			count += w;
			lastx = x;
			lastw = w;
		}
	}
	// display matched percent
	matchedtxtTc.classList.remove("hide");
	var pct = 100 * count / maxwidth;
	if (pct != 100) pct = pct.toFixed(1)
	matchedtxtTc.firstChild.nodeValue = "Matched: " + pct + "%";
}
